import React, { Component } from "react";


class Contact extends Component {
  render() {
    return (
      <div style={{ marginTop: "30px" }}>
       <div id="contact-container">

<div id="col1c">
<a name="contact"></a>
<h3>MANAGEMENT</h3>
<a href="mailto:info@tmwrk.net">info@tmwrk.net</a>

  </div>

  <div id="col2c">

<h3>BOOKINGS</h3>
<h4>USA</h4>
<br/>
<a class="two" href="mailto:agary@paradigmagency.com">agary@paradigmagency.com </a>

</div>

  <div id="col3c">

<h5>GLOBAL</h5>
<br/>
<a class="three" href="mailto:paul@primarytalent.com">paul@primarytalent.com </a>

</div>
</div>
      </div>
    );
  }
}

export default Contact;
